sys_variable_value.value:
(function execute(inputs, outputs) {
  var errUtil = new ErrorHandler();
  var urlRegex = /^(https?):\/\/([^\/]+)(\/[^?]*)(\?.+)?$/;
  var matches = inputs.uri.match(urlRegex);

  if(matches && matches.length > 1) {
    outputs.protocol = matches[1];
    outputs.server = matches[2];
    outputs.path = matches[3];

    var queryParameters = {};

    if(matches[4]) {
      var queryParams = matches[4].slice(1).split("&");

      for(var i = 0; i < queryParams.length; i++) {
        var keyValue = queryParams[i].split("=");

        if(keyValue.length == 2) {
          queryParameters[decodeURIComponent(keyValue[0])] = decodeURIComponent(keyValue[1]);
        }
      }
    }

    outputs.query_parameters = new global.JSON().encode(queryParameters);

  } else {
    throw errUtil.createError("Unable to parse URI. " + inputs.uri)
  }

})(inputs, outputs);

